        $rootScope.unique = function (a, b) {
            b.sort(function (a, b) {
                return (a.sims > b.sims ? 1 : b.sims > a.sims ? -1 : 0);
            });
            for (var i = 0; i < b.length; i++) {
                if (b[i] == undefined) {
                    b.splice(i, 1);
                    i--;
                }
            }
            for (var i = 1; i < b.length;) {
                if (b[i - 1].sims == b[i].sims) {
                    b.splice(i - 1, 1);
                } else {
                    i++;
                }
            }
            return b;
        };
